script: |
  super -f text -I q4350.spq | sort > q4350.out

inputs:
  - name: q4350.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE 72 / col0 + - + col0 NOT BETWEEN - - col2 AND ( col2 ) * col0;
  - name: tab2

outputs:
  - name: q4350.out
    data: |
      46	51	23
      64	77	40
      75	67	58
